import React, {Component} from 'react';
import Urbit from '@urbit/http-api';

window.urbit = Urbit("localhost:8080", "lidlut-tabwed-pillex-ridrup");
window.urbit.ship = "zod";

class App extends Component {
  state = {};

  constructor() {
    super();
    this.init();
  };

  componentDidMount() {
    this.scry();
  };

  async init() {
    window.urbit = await Urbit.authenticate({
      ship: "zod",
      url: "localhost:8080",
      code: "lidlut-tabwed-pillex-ridrup",
      verbose: true
    });
  };

  async scry() {
    const result = await window.urbit.scry({
      app: "graph-store",
      path: "/keys"
    });
    this.setState(result);
  };


  render() {
    return <pre>{JSON.stringify(this.state, null, 2)}</pre>;
  }
}

export default App;
